  - name: TEXT4000
    number: '6'
    value: '1. The transfer of $4,890.45 to the SCGOP Federal Account was for a refund
      of overpaid allocation for joint expenditures.  The money was transferred from
      our Federal account to our Nonfederal account, but mistakenly reported as a
      disbursement to our Federal account. We amended the report accordingly.  2.  The
      SCGOP applies the following Best Effort procedure:  first, our original solicitation
      includes a clear and conspicuous request for the contributor information and
      informs the contributor of the requirements of federal law for the reporting
      of such information.  If the information is not provided, we make one follow-up,
      stand alone effort to obtain the information within 30 days of the receipt of
      the contribution, either by letter or telephone.  If we receive the contributor
      information, we file the changes with our next report. 3.  We amended the return
      to change inadequately identified employer and occupation information.  4. The
      expenditures made for Printing on Schedule B were not made on behalf of a clearly
      identified federal candidate for Federal office and did not promote, support,
      attack, or oppose any candidate for Federal office.  5. The payments on Schedule
      H4 for insurance were for employees who did not spend 25% or more of their time
      on FEA or activities in connection with a Federal election.  6. The payments
      for contract labor/janitor were made to an individual who is not our employee.  He
      is a self employed individual who has a janitorial service and other clients
      and we hired him to clean our offices.  6. We have amended the report to reflect
      the proper allocation ratio on schedule H 1 and H4. Furthermore, we have repaid
      the overpayment to our Non-Federal account on October 2007 and reported this
      in our November 2007 report.   7. We have amended the report to reflect the
      ratio on Schedule H2 to be as previously reported. 8. The payments to Strategic
      and Columbia Business Equipment for equipment rental are for our copier, fax,
      and telephone and were allocated according to the ratio on Schedule H1.  The
      payment to ACS was for equipment we rented for our Silver Elephant Gala 2007
      and was allocated according to the ratio on Schedule H2.  9. We have amended
      the report to reflect the sum of the memo entries to equal the sum of the reimbursements.  10.
      The disbursements on Schedule B totaling $ 465.78 for credit card discount represent
      the fee the credit card companies charge us when we process credit card donations.  We
      will label them credit card fees in the future and have amended the report accordingly.  11.
      We amended the return to show all memo entries for reimbursements    '
  - value: ''
  expected_count: 6
  input: "TEXT\x1CC00034033\x1CTEXT.1\x1C\x1CF3XA\x1C1. The transfer of $4,890.45
    to the SCGOP Federal Account was for a refund of overpaid allocation for joint
    expenditures.  The money was transferred from our Federal account to our Nonfederal
    account, but mistakenly reported as a disbursement to our Federal account. We
    amended the report accordingly.  2.  The SCGOP applies the following Best Effort
    procedure:  first, our original solicitation includes a clear and conspicuous
    request for the contributor information and informs the contributor of the requirements
    of federal law for the reporting of such information.  If the information is not
    provided, we make one follow-up, stand alone effort to obtain the information
    within 30 days of the receipt of the contribution, either by letter or telephone.
    \ If we receive the contributor information, we file the changes with our next
    report. 3.  We amended the return to change inadequately identified employer and
    occupation information.  4. The expenditures made for Printing on Schedule B were
    not made on behalf of a clearly identified federal candidate for Federal office
    and did not promote, support, attack, or oppose any candidate for Federal office.
    \ 5. The payments on Schedule H4 for insurance were for employees who did not
    spend 25% or more of their time on FEA or activities in connection with a Federal
    election.  6. The payments for contract labor/janitor were made to an individual
    who is not our employee.  He is a self employed individual who has a janitorial
    service and other clients and we hired him to clean our offices.  6. We have amended
    the report to reflect the proper allocation ratio on schedule H 1 and H4. Furthermore,
    we have repaid the overpayment to our Non-Federal account on October 2007 and
    reported this in our November 2007 report.   7. We have amended the report to
    reflect the ratio on Schedule H2 to be as previously reported. 8. The payments
    to Strategic and Columbia Business Equipment for equipment rental are for our
    copier, fax, and telephone and were allocated according to the ratio on Schedule
    H1.  The payment to ACS was for equipment we rented for our Silver Elephant Gala
    2007 and was allocated according to the ratio on Schedule H2.  9. We have amended
    the report to reflect the sum of the memo entries to equal the sum of the reimbursements.
    \ 10. The disbursements on Schedule B totaling $ 465.78 for credit card discount
    represent the fee the credit card companies charge us when we process credit card
    donations.  We will label them credit card fees in the future and have amended
    the report accordingly.  11. We amended the return to show all memo entries for
    reimbursements    \x1C"
